import Jumbotron from 'react-bootstrap/Jumbotron';
import Row from 'react-bootstrap/Row';

function Carousel(props) {
  return (
    <Jumbotron>
          <div className='row text-center'>
        <h1>{props.title}</h1>
        <p>
            {props.text}
        </p>
        <p>
            {/* <Button bsStyle="primary">Learn more</Button> */}
        </p>
        </div>

    </Jumbotron>
  );
}

export default Carousel;
